[{"location":"","page":"Home","title":"Home","text":"CurrentModule = Rank2BinaryForms","category":"page"},{"location":"#Rank2BinaryForms","page":"Home","title":"Rank2BinaryForms","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for Rank2BinaryForms. Package to compute the roots of the polynomials in the image of the map \\Gamma defined in ArXiv 1901.08320.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [Rank2BinaryForms]","category":"page"},{"location":"#Rank2BinaryForms.Image_affineGamma-Tuple{Any}","page":"Home","title":"Rank2BinaryForms.Image_affineGamma","text":"Image_affineGamma(d)\n\n\nReturns the roots of all the polynomials in the image of Γ.\n\n\n\n\n\n","category":"method"},{"location":"#Rank2BinaryForms.affineGamma-Tuple{Any}","page":"Home","title":"Rank2BinaryForms.affineGamma","text":"affineGamma(d)\n\n\nReturns a function that computes the unknown roots of the polynomial Γ(triplet).\n\n\n\n\n\n","category":"method"},{"location":"#Rank2BinaryForms.buildpolynomial-Tuple{Any, Any}","page":"Home","title":"Rank2BinaryForms.buildpolynomial","text":"buildpolynomial(roots, vars)\n\n\nGeneric function to build the polynomials in the image of Γ from the list of roots.\n\n\n\n\n\n","category":"method"},{"location":"#Rank2BinaryForms.crossratio-NTuple{4, Any}","page":"Home","title":"Rank2BinaryForms.crossratio","text":"crossratio(A, B, C, D)\n\n\nReturns the cross ratio of four numbers. There is also the method:\n\ncrossratio(v) = crossratio(v...)\n\n\n\n\n\n","category":"method"},{"location":"#Rank2BinaryForms.set_getting_rootsofunity-Tuple{Any}","page":"Home","title":"Rank2BinaryForms.set_getting_rootsofunity","text":"set_getting_rootsofunity(f)\n\n\nSets the method used to compute the d-th roots of unity. The input is a function f computing the roots of unity accepting calls as f(d)(k) and returning the k-th root of the d-th roots of unity. The order of the d-th roots of unity can be clockwise or anti-clockwise, but they must be ordered. Examples of valid inputs are the following functions f and g:\n\n    g(d) = k -> exp(2*pi*im*k/d)\n    using Nemo\n    CC = ComplexField(64);\n    f(d) = k -> Nemo.root_of_unity(CC, d)^k;\n\n\n\n\n\n","category":"method"},{"location":"#Rank2BinaryForms.triplets-Tuple{Any}","page":"Home","title":"Rank2BinaryForms.triplets","text":"triplets(d)\n\n\nReturns a vector of triplets [i,j,k] of integers 1 <= i < j < k <= d, up to the action of the d-th dihedral group.\n\n\n\n\n\n","category":"method"},{"location":"#Rank2BinaryForms.tuples-Tuple{Any}","page":"Home","title":"Rank2BinaryForms.tuples","text":"tuples(d)\n\n\nReturns a vector of vectors resulting to pushfirst each integer 1:d in triplet.\n\n\n\n\n\n","category":"method"}]
